    # #print(obj['tags']['rateSum'])
    for y in obj['tags']['tagClouds']:
        #print(y['tag'] + str(y['count']))
        impress.impress[y['tag']] = str(y['count'])
    impress.impress['date'] = date
    impress.id = 'id=' + id
    impress._id = 'id=' + id
    return impress

